import React from 'react';
import EmpresaCard from './EmpresaCard';

import logoOlva from '../assets/empresas_fotos/olva_logo.jpg';
import shalóm from '../assets/empresas_fotos/sa';
import logoEmpresa3 from '../assets/empresas_fotos/empresa3_logo.jpg';
import logoEmpresa4 from '../assets/empresas_fotos/empresa4_logo.jpg';

import './Empresas.css';

const Empresas = () => {
  const empresasData = [
    {
      nombre: "Olva Courier",
      direccion: "Avenida Argentina 4458, Callao, Perú",
      evaluaciones: 0,
      valoracion: 4.95,
      caracteristicas: ["Puntualidad", "Seguridad", "Económica", "Amabilidad", "Caro", "Inseguro", "Impuntual"],
      descripcion: "Especialistas en última milla, brindando servicios de calidad en transporte de encomiendas a domicilio o a cualquiera de nuestras tiendas o agentes a nivel ...",
      mapaUrl: "https://www.google.com/maps/place/Olva+Courier+Central/@-12.0486303,-77.0993648,15z/data=!4m6!3m5!1s0x9105c954339772e7:0xa66e7836d17a0617!8m2!3d-12.0486303!4d-77.0993648!16s%2Fg%2F11bxc7kpx2?entry=ttu",
      logoUrl: logoOlva
    },
    {
      nombre: "Shalóm",
      direccion: "Avenida México 1187,Cercado de Lima, Perú",
      evaluaciones: 1,
      valoracion: 6,
      caracteristicas: ["Eficiencia", "Rapidez", "Calidad"],
      descripcion: "Shalom tiene una amplia red de distribución de puntos de entrega y acopio en los 24 departamentos del Perú",
      mapaUrl: "https://www.google.com/maps/place/Empresa+2/@-12.0486303,-77.0993648,15z/data=!4m6!3m5!1s0x9105c954339772e7:0xa66e7836d17a0617!8m2!3d-12.0486303!4d-77.0993648!16s%2Fg%2F11bxc7kpx2?entry=ttu",
      logoUrl: logoShalom
    },
    {
      nombre: "Empresa 3",
      direccion: "Dirección 3, Callao, Perú",
      evaluaciones: 20,
      valoracion: 4.70,
      caracteristicas: ["Eficiencia", "Calidad"],
      descripcion: "Otra descripción para Empresa 3.",
      mapaUrl: "https://www.google.com/maps/place/Empresa+3/@-12.0486303,-77.0993648,15z/data=!4m6!3m5!1s0x9105c954339772e7:0xa66e7836d17a0617!8m2!3d-12.0486303!4d-77.0993648!16s%2Fg%2F11bxc7kpx2?entry=ttu",
      logoUrl: logoEmpresa3
    },
    {
      nombre: "Empresa 4",
      direccion: "Dirección 4, Callao, Perú",
      evaluaciones: 5,
      valoracion: 4.85,
      caracteristicas: ["Calidad", "Rapidez"],
      descripcion: "Otra descripción para Empresa 4.",
      mapaUrl: "https://www.google.com/maps/place/Empresa+4/@-12.0486303,-77.0993648,15z/data=!4m6!3m5!1s0x9105c954339772e7:0xa66e7836d17a0617!8m2!3d-12.0486303!4d-77.0993648!16s%2Fg%2F11bxc7kpx2?entry=ttu",
      logoUrl: logoEmpresa4
    }
  ];

  return (
    <div className="host-list">
      {empresasData.map((empresa, index) => (
        <EmpresaCard
          key={index}
          nombre={empresa.nombre}
          direccion={empresa.direccion}
          evaluaciones={empresa.evaluaciones}
          valoracion={empresa.valoracion}
          caracteristicas={empresa.caracteristicas}
          descripcion={empresa.descripcion}
          mapaUrl={empresa.mapaUrl}
          logoUrl={empresa.logoUrl}
        />
      ))}
    </div>
  );
};

export default Empresas;
